INSERT INTO `about_us` (`id`, `description`, `created_at`, `created_by`) VALUES
(1, '<p style=\"text-align: left; color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, sans-serif;\">WAEPA BANGLAESH – THE VOICE OF WOMEN TECHNICAL PROFESSIONALS In a country like Bangladesh, where almost half the population is comprised of women, it is an absolutely necessity that they contribute to the national development. Women in Bangladesh still remain underrepresented in the technical professions. While gender inequality has been improving here, discrimination still prevails in this sector of career development. Ensuring effective career opportunities for women in technical profession still remains a challenge while a common platform addressing burning issues of women in technical profession facilitating their career advancement is a matter of high demand. Keeping this in mind, Women Architects, Engineers and Planners Association (WAEPA), Bangladesh was founded on July 28, 2005 and subsequently licensed and registered under Section 28 of the Companies Act 1994. A great number of women have caught up with their male counterparts and now graduating in Architecture, Engineering and Planning disciplines. Even though these women technical professionals are making significant contributions in national development programmes, policies and individual career but there prevails a lot of challenges and limitations. WAEPA Bangladesh envisages in addressing these needs and challenges of women professionals, in guiding the younger professionals in their career journey as well as to focus on the achievements and contributions of its members. WAEPA pledges to make every effort to succeed in fulfilling its aims and objectives regarding the development and empowerment of Women Technical Professionals of Bangladesh so that their members can contribute in all the sectors of society be it familial, community and national level with their expertise and meticulous sincerity.&nbsp;</p><div style=\"text-align: center; \"><img src=\"data:image/png;base64,\" data-filename=\"Capture.PNG\" style=\"width: 299px;\"><br></div>', '2021-03-03 07:31:58', '1');

