INSERT INTO `aims_objective` (`id`, `description`, `created_at`, `created_by`) VALUES
(1, '<p>WAEPA Bangladesh believes in gender equality, gender friendly\r\nenvironment at work place and gender balance in technical\r\nprofessions. To fulfill its aims and objectives the organization shall\r\naddress the relevant issues focusing on the following:&nbsp;</p><ul><li> Problems at work place&nbsp;</li><li> Employment attitude </li><li>Barriers in employment </li><li>Representation of more women professionals in management,\r\npolicy and decision making processes.</li><li> Employment and equal participation of women professionals in\r\ndevelopment projects and programs.&nbsp;</li><li> Institutional capacity building for women in technical education and\r\nprofession&nbsp;</li><li> Positive societal attitudes towards women in technical profession.&nbsp;</li><li> Awareness development regarding familial support and enabling\r\nsocial support structures for working women in technical\r\nprofessions </li><li>Advocacy for advancement of career&nbsp;</li><li> Development of a central data base of women technical\r\nprofessionals.&nbsp;</li><li> Facilitating support to continual education, training and research.&nbsp;</li><li> Establishing links between all stakeholders (Public and Private,\r\nFinancial Institutions and Development Partners) at national and\r\ninternational levels<br></li></ul>', '2021-03-03 07:39:31', '1');

